import React from 'react';
import cube from './Images/Cube.png'
import Paper from '@mui/material/Paper';
import Stack from '@mui/material/Stack';
import Box from '@mui/material/Box';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import { styled } from '@mui/material/styles';
import './Aegis.css'

const Item = styled(Paper)(({ theme }) => ({
    ...theme.typography.body2,
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
}));

function AegisMaster(){
    return(
        <div>
           <Stack spacing={2} direction="row"justifyContent="center"alignItems="center">
           <Item>Current Plan</Item>
           <Card sx={{ minWidth: 275 }}>
           <CardContent>
           <Typography sx={{ fontSize: 34, textAlign: 'center'}} color="text.secondary" gutterBottom>Basic</Typography>
           <Typography sx={{ fontSize: 14, textAlign: 'center'}} color="text.secondary" gutterBottom>Supports 3 Cameras</Typography>
           <Typography sx={{ fontSize: 14, textAlign: 'center'}} color="text.secondary" gutterBottom></Typography>
           </CardContent>
           </Card>
           </Stack>
           <Stack spacing={2} direction="row"justifyContent="center"alignItems="center">
           <Item>$400</Item>
           <Item>Current Plan</Item>
           <Card sx={{ minWidth: 275 }}>
           <CardContent>
           <Typography sx={{ fontSize: 34, textAlign: 'center'}} color="text.secondary" gutterBottom>Basic</Typography>
           <Typography sx={{ fontSize: 14, textAlign: 'center'}} color="text.secondary" gutterBottom>Supports 3 Cameras</Typography>
           <Typography sx={{ fontSize: 14, textAlign: 'center'}} color="text.secondary" gutterBottom></Typography>
           </CardContent>
           </Card>
           <Item>$400</Item>
           </Stack>
        </div>
    )
}
export default AegisMaster;
